pragma solidity ^0.8.10;
/// @custom:security-contact security@k4rally.com
contract K4RallyTokenV2 is Initializable, ERC20Upgradeable, PausableUpgradeable, OwnableUpgradeable {

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function _beforeTokenTransfer(address from, address to, uint256 amount)
        internal
        whenNotPaused
        override
    {
        super._beforeTokenTransfer(from, to, amount);
    }

    function burn(address account, uint256 amount) onlyOwner public{
        //Burn functionality
        _burn(account, amount);
    }

    function mint(address account, uint256 amount ) onlyOwner public{
        //mint funcitonality
        _mint(account, amount);
    }
}

